import React, { Component } from 'react';
import { Row, Table } from 'react-bootstrap';

class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <Row style={{ width: '100%', margin: '0% 1.5% 1.5% 1.5%', background: 'white' }}>
                <Table  bordered hover responsive style={{padding: '0%', margin: '0%'}}>
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>First Name</th>
                            <th>Last Name</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>1</td>
                            <td>Mark</td>
                            <td>Otto</td>
                        </tr>
                        <tr>
                            <td>2</td>
                            <td>Jacob</td>
                            <td>Thornton</td>
                        </tr>
                    </tbody>
                </Table>
            </Row>
        );
    }
}

export default Products;
